import React from "react";
import { Col, Container } from "react-bootstrap";
import styles from './Navbar.module.css'
import '../../../../assets/styles/boxShadow.css'
import Input from '../../../common/input'
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faHome, faSearch } from "@fortawesome/free-solid-svg-icons";
function Navbar() {
    return(
        <Container fluid className={'fancy-shadow d-flex align-items-center p-0'}>
            <Col md={2} className={`${styles['container-navbar']} bg-dark`}>
            <   h2 className={`${styles['text-nav']}`}>Vibragram</h2>
            </Col>
            <Col md={6} className="bg-dark">
                <Input 
                iconbefore={faSearch}
                placeholder='Search friends'
                classgroup={`${styles['container-input']}`}
                />
            </Col>
        </Container>
    )
}

export default Navbar












